import React from 'react';
import Box from '@material-ui/core/Box';
import '.score.css';

export const Score = ({ number}) => {
    return (
        <Box fontFamily="fontFamily" m={2} className={`app-score--`}>
            { number }
        </Box>
    );
}

export default Score;
